import React from "react";
function Submit(){
    const style={
        //提交留言的样式
        width:'500px',
        height:'50px',
        marginTop: '10px',
        fontsize: '80px'
    }
    const value=90
    const form_style=
    {
        //整个提交框的样式
        width: '1000px',
        height: '500px',
        marginLeft:'100px',
        marginTop:'10px',
        border:'1px solid ',
        padding:'30px'
    }
    const button_style={
        marginBottom:'10px',
        width:'100px'
    }
    return(
        <div>
            <form action="" style={form_style}>
                名字 <input type="text"/><br/>
                留言<input type="text" style={style} value={value}/> <br/>
                <button style={button_style}>提交</button>
            </form>
        </div>
    )
}
export default Submit
